@Jackonya относитесь проще к переводам. Со стороны ваши версии выглядят как истина в последней инстанции. Исходите из того, что тоже можете ошибаться.
Местоимения Вы, Ваш пишутся с прописной буквы при обращении к одному лицу в текстах следующих жанров:
а) личное письмо (адресат – одно лицо); 
б) официальные документы, адресованные одному лицу; 
в) анкеты, рекламные листовки (текст, адресованный неконкретному лицу).
Это цитата с Грамоты.Ру.
Общепринято при переводе приложений и интерфейсов сайтов использовать написание со строчной буквы. С заглавной если и встретишь, то это будет непрофессиональный перевод. Кстати, с недавних пор написание Вы с большой буквы появилось в OSx - назовем это исключением. Может к сентябрю (новому релизу) исправят.
Практически все серьезные фирмы в инструкциях по переводам указывают, что писать вы нужно с маленькой буквы (например Xiaomi). Также принято не использовать букву "ё" в переводах.

